import store from '../store'
import dialogService from './dialogService'

class guideService {
  static login(guider) {
    dialogService.confirm('您还没有登录,是否马上登录或注册', function(login) {
      if (login) {
        store.commit('system/updateRedirect', window.location.hash.substring(1))
        if (guider) store.commit('system/registerGuide', guider)
        window.location.href = window.host + '/login'
      }
    })
  }
}

export default guideService
